css:
ul.tab-bar > li.tab.of-highlight,
ul.tab-bar > li.tab.of-highlight:before,
ul.tab-bar > li.tab.of-highlight:after {
  background-color: #31363f;
}
.file-list .of-highlight.directory:before,
.file-list .of-highlight.file:before {
  content: '';
  background-color: #31363f;
  position: absolute;
  left: 0;
  right: 0;
  height: 25px;
}
.file-list.opened-files .save {
  z-index: 2;
  position: absolute;
  top: 3px;
  right: 0;
}
.file-list.opened-files {
  padding-left: 6px;
  width: 100%;
  background-color: #21252b;
  overflow: scroll;
  min-height: 33px;
  max-height: 210px;
  flex: 0 0 auto;
}
.file-list.opened-files > ol.list-tree {
  font-size: 11px;
}
.file-list.opened-files > ol.list-tree span.icon {
  display: inline-block;
}
.file-list.opened-files > ol.list-tree span.path {
  font-size: 0.9em;
  padding-left: 6px;
  color: rgba(157, 165, 180, 0.6);
}
.file-list.opened-files > ol.list-tree span.name {
  font-size: 1.025em;
}
.file-list.opened-files > ol.list-tree li.file {
  padding-left: 0;
}
.file-list.opened-files > ol.list-tree .file > span.icon-x {
  position: relative;
  width: 0px;
  left: -16px;
  top: 0px;
}
.file-list.opened-files > ol.list-tree .file > span.icon-x.not-hovered {
  color: #21252b;
}
.file-list.opened-files > ol.list-tree .file.selected > span.icon-x.not-hovered {
  color: #3a3f4b;
  text-shadow: none;
}
.file-list.opened-files > ol.list-tree .directory .icon-x {
  z-index: 10;
  margin-left: .5em;
}
.file-list.opened-files > ol.list-tree .directory.list-nested-item .list-tree.entries {
  max-height: 25vh;
  overflow: auto;
}
.file-list.opened-files > ol.list-tree .file .icon-paintcan {
  margin-left: .5em;
}
